model_class: GPModel
input_variables:
  Prepulse Delay:
    variable_class: ScalarVariable
    default_value: 70.0
    is_constant: false
    value_range: [67.41, 71.41]
    value_range_tolerance: 1.0e-08
  Target focus:
    variable_class: ScalarVariable
    default_value: -56.84
    is_constant: false
    value_range: [-56.87, -56.81]
    value_range_tolerance: 1.0e-08
output_variables:
  energy_in_harmonics_sim_task: {variable_class: DistributionVariable, distribution_type: MultiVariateNormal}
input_validation_config: null
output_validation_config: null
device: cpu
precision: double
model: qed_ip2_model.pt
input_transformers: [qed_ip2_input_transformers_0.pt]
output_transformers: [qed_ip2_output_transformers_0.pt]
